8243","exception":false,"start_time":"2023-01-19T07:54:24.470792","status":"completed"},"tags":[]},"source":["Director of marketing believes the company’s future success depends on maximizing the number of annual memberships. But, before we need to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, our team will design a new marketing strategy to convert casual riders into annual members. We will develop this tasks and a the end we will present compelling data insights and share a professional data visualization."]},{"cell_type":"markdown","id":"b78cc9a7","metadata":{"papermill":{"duration":0.016551,"end_time":"2023-01-19T07:54:24.521188","exception":false,"start_time":"2023-01-19T07:54:24.504637","status":"completed"},"tags":[]},"source":["In  2016,  Cyclistic  launched   a successful  bike-share  offering.  Since  then,  the  program  has  grown  to   a fleet  of  5,824  bicycles  that are  geotracked  and  locked  into   a network  of  692  stations across  Chicago. One  approach  that  helped  make  these  things  possible was  the  flexibility  of  its  pricing  plans:  single-ride passes,  full-day  passes, and  annual  memberships.  Customers  who  purchase  single-ride or  full-day  passes  are  referred  to  as  **casual  riders.** Customers who  purchase  annual  memberships  are **Cyclistic  members. **"]},{"cell_type":"markdown","id":"fc4d5776","metadata":{"papermill":{"duration":0.016807,"end_time":"2023-01-19T07:54:24.554423","exception":false,"start_time":"2023-01-19T07:54:24.537616","status":"completed"},"tags":[]},"source":["This is a Capestone Project, as a part of a course: Google Data Analytic Professional Certificate. All tools and language learned comes from this course."]},{"cell_type":"markdown","id":"c3a858bb","metadata":{"papermill":{"duration":0.01603,"end_time":"2023-01-19T07:54:24.586594","exception":false,"start_time":"2023-01-19T07:54:24.570564","status":"completed"},"tags":[]},"source":["# Ask"]},{"cell_type":"markdown","id":"5f571692","metadata":{"papermill":{"duration":0.017143,"end_time":"2023-01-19T07:54:24.620598","exception":false,"start_time":"2023-01-19T07:54:24.603455","status":"completed"},"tags":[]},"source":["Director of Marketing set a clear goal: strategies aimed at converting casual riders into annual members. In order to do that the marketing analyst team needs to better understand three questions:  \n","**1. how annual members and casual riders use differ  \n","2. why casual riders would buy a membership,and  \n","3. and how digital media could affect their marketing tactics.**"]},{"cell_type":"markdown","id":"e3a22154","metadata":{"papermill":{"duration":0.017788,"end_time":"2023-01-19T07:54:24.65492","exception":false,"start_time":"2023-01-19T07:54:24.637132","status":"completed"},"tags":[]},"source":["# Prepare\n","## Dataset"]},{"cell_type":"markdown","id":"6762f298","metadata":{"papermill":{"duration":0.016683,"end_time":"2023-01-19T07:54:24.688903","exception":false,"start_time":"2023-01-19T07:54:24.67222","status":"completed"},"tags":[]},"source":["I will use R language, R Markdown to document and share insights, Tableau to create attractive visualiations and Google Slides to present insigths at the stakeholders."]},{"cell_type":"markdown","id":"3003fa81","metadata":{"papermill":{"duration":0.016066,"end_time":"2023-01-19T07:54:24.720847","exception":false,"start_time":"2023-01-19T07:54:24.704781","status":"completed"},"tags":[]},"source":["We will  use  Cyclistic’s  historical  trip  data  to  elaborate metrics, analyze it ,and if is possible identify patterns and trends.  \n","  \n","First, I downloaded the latest 12 months of data from Dec 2021 - Nov 2022, and upload it to Kaggle. Data was downloaded from Motivate international Inc to my desktop.  \n","  \n","Our date was verifiable as Reliable (data is umbiased), Original(data comes from original source), Comprehensive (contains neccesary data to answer the questions)